@gisele LEIA MEU COMENTÁRIO POR FAVOR 🔥🔥🔥🔥🔥🔥🔥🔥Emprego vai pintar na hora que Deus achar conveniente. Mas por hora, queria celebrar a vida e meu aniversário, me ajuda . Linda ,Olá me chamo Márcia. Felicidades.Vc teria algo Tam 44 pra me emprestar ou doar? até sapato 37. Sei q esse não é seu manequim, mas como vc  sempre é diva, deve ter algo , possa arrumar ou algo que não use mais, e eu possa  ajeitar. Faço aniversário dia 30/08 . Estou desempregada mesmo, a 1 ano. Mas parentes e amigos irão arcar com a festinha do meu niver de 44 no final de outubro. Poderia me ajudar, doando ou emprestando um vestido bonito, longo ou curto Tam 44 e/ou sapato 37, usado de presente? Eu devolvo. Sou do Rio de Janeiro.
Se não quiser e puder, só me falar q não incomodo mais. Vc não é obrigada a atender ao meu pedido, por ser uma pessoa pública. Só peço compreensão e não humilhação
🙌🙌🙌🙌🙌🙌🙌🙌🙌🙌🙌
